class MobileApiController < ApplicationController
  	skip_before_filter :verify_authenticity_token #this may be dangerous, check
  	before_filter :authenticate_user_from_token!

	#check logins here
	def auth
		if user_signed_in?
			render :json => {response:'accepted auth token', status:'success'}
		else
			render :json => {response:'auth token not accepted', status:'fail'}
		end
	end

	#endpoint for logging in from a mobile app
	#CURRENTLY INSECURE
	def mobile_login
		email = params[:user_email]
		pass = params[:password]

		if not email.present? or not pass.present?
			render :json => {response:'missing parameters', status:'fail'}
		else
			user = User.find_by_email(email)

			if not user
				render :json => {response:'user not found', status:'fail'}
			else
				user.ensure_authentication_token
				render :json => {response:'user logged in',status:'success', user:user}
			end
		end
	end

	#create a new lecture object for the passed user. 
	def create_lecture
		email = params[:user_email]

		if not email.present?
			render :json => {response:'missing parameters', status:'fail'}
		else
			#find user with email
			user = User.find_by_email(email)

			if not user.present?
				render :json => {response:'user not found', status:'fail', parameters:params}
			else
				#add the lecture to id 1
				subject = user.subjects.find_by_id(1)
				lecture = Lecture.new(name:'New Lecture', subject_id:subject.id)

				if lecture.save
					lecture.update_attributes(name:"New Lecture #{lecture.id}")
					render :json => {response:'saved new lecture', status:'success', lecture:lecture}
				else
					render :json => {response:'an error occured creating new lecture', status:'fail', parameters:lecture.errors.full_messages}
				end
			end
		end
	end

	#uploading an image
	def upload_image
		if not user_signed_in?
			render :json => {response:'auth token not accepted', status:'fail'}
		end

		#information = request.raw_post
		#data_parsed = JSON.parse(information)
		json = JSON.parse(request.body.read())
		#puts 'JSON ' + json
		#new_trip = json["trip"]

		#properly prints out the arguments
		#render :json => {status: 'success', submitted_content:json, new_trip:new_trip} 
		#image = Image.new(json)

		#source = StringIO.new(Base64.decode64(json[:image_data]))

		image = Image.new(name:json["name"], lecture_id:json["lecture_id"])
		
		data = StringIO.new(Base64.decode64(json["image_data"]))
		data.class.class_eval { attr_accessor :original_filename, :content_type }
		data.original_filename = json["name"]
		data.content_type = json["image_type"]

		image.source = data

		#render :json => {status: 'test', content:json, sample_image: i}

		if image.save
			render :json => {status: 'success', new_image:image}
		else
			render :json => {status: 'failure', errors:image.errors.full_messages, posted_content:json}
		end

	end

	def authenticate_user_from_token!
	    user_email = params[:user_email].presence
	    user       = user_email && User.find_by_email(user_email)
	 
	    # Notice how we use Devise.secure_compare to compare the token
	    # in the database with the token given in the params, mitigating
	    # timing attacks.
	    if user && Devise.secure_compare(user.authentication_token, params[:user_token])
	      sign_in user, store: false
	    end
	end
end

